const Header = ({ name }) => <h1>{name}</h1>
//const Total = ({ sum }) => <p>Number of exercises {sum}</p>
const Part = ({ part }) => 
  <p> {part.name} {part.exercises} </p>

const Content = ({ parts }) => 
  <>
    <Part part={parts[0]} />
    <Part part={parts[1]} />
    <Part part={parts[2]} /> 
    <Part part={parts[3]} />      
  </>

const Course = ({course}) => {
  return(
      <>
          <Header name = {CountQueuingStrategy.name} />
          <Content parts = {course.parts} />
          <Total course = {course}/>
      </>
  )
}

const Total = ({ course }) => {
  const total = course.parts.reduce(
      (total, part) => { return total + part.exercises}, 0 );
  return(
    <p><b>Total of {total} exercises</b></p>
  ) 
}


const App = () => {
  const course = [
    {
      name: 'Half Stack application development',
      id: 1,
      parts: [
        {
          name: 'Fundamentals of React',
          exercises: 10,
          id: 1
        },
        {
          name: 'Using props to pass data',
          exercises: 7,
          id: 2
        },
        {
          name: 'State of a component',
          exercises: 14,
          id: 3
        },
        {
          name: 'Redux',
          exercises: 11,
          id: 4
        }
      ]
    }, 
    {
      name: 'Node.js',
      id: 2,
      parts: [
        {
          name: 'Routing',
          exercises: 3,
          id: 1
        },
        {
          name: 'Middlewares',
          exercises: 7,
          id: 2
        }
      ]
    }
  ]

  return <Course course={course} />
}

export default App


